-- Table structure for table `Operaciones`
--

DROP TABLE IF EXISTS `Operaciones`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `Operaciones` (
  `idOperacion` int(11) NOT NULL,
  `idProfesional` int(11) DEFAULT NULL COMMENT 'borrar las columnas de informacion de profesional, ya aqui tenemos el ID',
  `idUsuario` int(11) DEFAULT NULL COMMENT 'Operacion realziada por el usuario = idUsuario.\nEn caso de que idUsuario sea null, quiere decir que el profesional realizo la operacion, no un usuario de admin',
  `idCliente` int(11) DEFAULT NULL,
  `idTarjeta` int(11) DEFAULT NULL COMMENT 'Borrar columna tarjeta enum despues de recuperar la informacion aqui.',
  `dniProfesional` bigint(20) DEFAULT NULL COMMENT 'DNI o CUIT = 11 numeros max\n',
  `apellidoProfesional` varchar(45) DEFAULT NULL,
  `nombreProfesional` varchar(45) DEFAULT NULL,
  `mailProfesional` varchar(45) DEFAULT NULL,
  `fechaTransaccion` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `fechaPago` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `dniCliente` bigint(20) NOT NULL,
  `apellidoCliente` varchar(45) NOT NULL,
  `nombreCliente` varchar(45) NOT NULL,
  `telefonoCliente` varchar(20) DEFAULT '-',
  `mailCliente` varchar(45) DEFAULT '-',
  `tipoTarjeta` char(1) NOT NULL DEFAULT 'C',
  `tipoOperacion` varchar(25) DEFAULT NULL COMMENT 'MP,POINT, ETC',
  `importeVenta` decimal(10,2) NOT NULL,
  `importeCobrar` decimal(10,2) NOT NULL,
  `cuotas` tinyint(4) NOT NULL,
  `importeCuota` decimal(10,2) NOT NULL,
  `importeCarga` decimal(10,2) NOT NULL,
  `codigoAuto` int(11) NOT NULL,
  `cupon` bigint(20) NOT NULL,
  `estadoPago` varchar(10) NOT NULL DEFAULT 'PAGADA',
  `coinciliada` char(2) NOT NULL DEFAULT 'SI',
  `suspendida` varchar(10) DEFAULT NULL,
  `fechaOperacion` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `estado` char(1) NOT NULL DEFAULT 'A',
  `tarjeta` enum('VISA','MASTER','AMEX','MP','MP1') DEFAULT NULL,
  PRIMARY KEY (`idOperacion`),
  KEY `fk_idProfesional_operaciones_idx` (`idProfesional`),
  KEY `fk_idUsuario_operaciones_idx` (`idUsuario`),
  KEY `fk_idTarjeta_operaciones_idx` (`idTarjeta`),
  KEY `fk_idCliente_operaciones_idx` (`idCliente`),
  CONSTRAINT `fk_idCliente_operaciones` FOREIGN KEY (`idCliente`) REFERENCES `Clientes` (`idCliente`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_idProfesional_operaciones` FOREIGN KEY (`idProfesional`) REFERENCES `ProfesionalesTemp` (`idProfesional`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_idTarjeta_operaciones` FOREIGN KEY (`idTarjeta`) REFERENCES `Tarjetas` (`idTarjeta`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_idUsuario_operaciones` FOREIGN KEY (`idUsuario`) REFERENCES `Usuarios` (`idUsuario`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

