CREATE DEFINER=`root`@`localhost` PROCEDURE `migrar_datos2`()
BEGIN
	DECLARE bandera INT;
	DECLARE finLoop INT;
	-- Informacion cliente
	DECLARE mIdCliente INT;
	DECLARE mDni BIGINT(20);
	DECLARE mNombre VARCHAR(45);
	DECLARE mApellido VARCHAR(45);
	DECLARE mMail VARCHAR(45);
	DECLARE mTelefono VARCHAR(45);
	DECLARE mFechaAlta TIMESTAMP; -- esta fecha de alta sera la de la primera operacion del cliente, ya que no sabemos del sistema viejo

	 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
		 BEGIN
			GET DIAGNOSTICS CONDITION 1
			@c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
			SELECT 0 AS codigo, CONCAT('Error numero: ',@c1,'. Descripcion: ',@c2)AS mensaje;
			ROLLBACK;
		 END;

	-- creamos los clientes (dueños de tarjetas)
	SET bandera = 50001;
	SET finLoop = (SELECT idOperacion FROM Operaciones ORDER BY idOperacion DESC LIMIT 1);
	LAZO1 : LOOP
		IF EXISTS (SELECT idOperacion FROM Operaciones WHERE idOperacion = bandera) THEN
			SET mDni = (SELECT dniCliente FROM Operaciones WHERE idOperacion = bandera);
			-- me fijo si existe para crearlo o no
			IF NOT EXISTS (SELECT idCliente FROM Clientes WHERE dni=mDni) THEN
				BEGIN
					-- salida de loop
					IF (bandera > finLoop) THEN
						LEAVE LAZO1;
					END IF;
					-- seteo todo los parametros de la tabla clientes para crearlo
					SET mIdCliente = 1 + (SELECT COALESCE(MAX(idCliente),0) FROM Clientes);
					SET mDni = (SELECT dniCliente FROM Operaciones WHERE idOperacion = bandera);
					SET mNombre = (SELECT nombreCliente FROM Operaciones WHERE idOperacion = bandera);
					SET mApellido = (SELECT apellidoCliente FROM Operaciones WHERE idOperacion = bandera);
					SET mMail = (SELECT mailCliente FROM Operaciones WHERE idOperacion = bandera);
					SET mTelefono = (SELECT telefonoCliente FROM Operaciones WHERE idOperacion = bandera);
					SET mFechaAlta = (SELECT fechaOperacion FROM Operaciones WHERE idOperacion = bandera);
					
					-- agregamos el nuevo cliente dueño de tarjeta
					INSERT INTO Clientes VALUES (mIdCliente,mDni,mNombre,mApellido,mMail,mTelefono,mFechaAlta,'A');
					-- ahora que se creo el cliente dueño de tarjeta, se ingresa su ID en la tabla OPERACIONES
					UPDATE Operaciones
					SET idCliente=mIdCliente 
					WHERE idOperacion = bandera;
				END;
			ELSE
				SET mIdCliente = (SELECT idCliente FROM Clientes WHERE dni=mDni);
				-- ahora que se creo el cliente dueño de tarjeta, se ingresa su ID en la tabla OPERACIONES
					UPDATE Operaciones
					SET idCliente=mIdCliente 
					WHERE idOperacion = bandera;
			END IF;
		END IF;
		SET bandera = bandera + 1;
	END LOOP LAZO1;

END ;;
DELIMITER ;
