CREATE DEFINER=`root`@`localhost` PROCEDURE `operacion_modificar_estadoPago`(oIdOperacion INT)
PROC: BEGIN

    DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN
		GET DIAGNOSTICS CONDITION 1
        @c1 = RETURNED_SQLSTATE, @c2 = MESSAGE_TEXT;
		SELECT 0 AS codigo, CONCAT('Error numero: ',@c1,'. Descripcion: ',@c2)AS mensaje;
		ROLLBACK;
	END;
    
	IF NOT EXISTS (SELECT idOperacion FROM Operaciones WHERE idOperacion = oIdOperacion AND estado = 'A') THEN
		SELECT 0 as codigo, 'La operacion no existe' mensaje;
        LEAVE PROC;
	END IF;
    
    IF (SELECT estadoPago FROM Operaciones WHERE idOperacion = oIdOperacion AND estado = 'A') = 'PAGADA' THEN
		SELECT 0 as codigo, 'La operacion ya se encuentra pagada' mensaje;
        LEAVE PROC;
	END IF;

	START TRANSACTION;
		UPDATE Operaciones 
        SET estadoPago='PAGADA'
        WHERE idOperacion=oIdOperacion;
		SELECT oIdOperacion as codigo, 'Operacion pagada con exito.' mensaje;
	COMMIT;
END ;;
